import { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css"; // CSS file import

export default function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="navbar">
      <div className="nav-container">
        <h1 className="logo">GenVision 2025</h1>

        <ul className={`nav-links ${isOpen ? "active" : ""}`}>
          <li><Link to="/" onClick={() => setIsOpen(false)}>About</Link></li>
          <li><Link to="/Events" onClick={() => setIsOpen(false)}>Events</Link></li>
          <li><Link to="/Participants" onClick={() => setIsOpen(false)}>Participate</Link></li>
          <li><Link to="/Coordinators" onClick={() => setIsOpen(false)}>Coordinators</Link></li>
          <li><Link to="/Guests" onClick={() => setIsOpen(false)}>Guests</Link></li>
        </ul>

        <div className={`hamburger ${isOpen ? "toggle" : ""}`} onClick={() => setIsOpen(!isOpen)}>
          <span></span>
          <span></span>
          <span></span>
        </div>
      </div>
    </nav>
  );
}
